  array('id' => '3897','uts_id' => '5','mahasiswa_id' => '487','bank_soal_pembahasan_id' => '220','jawaban_id' => '717','nilai' => '1','alasan' => 'p=0 beati peulangan dimulai dai 0 dan while<2 beati batas peulangan<2. Output mencetak "Univesitas Univesitas bengkulu" kaena petama sistem akan mencetak Univesitas lalu mengecek kondisi kembali apakah masih memenuhi dan "Univesitas" di incement, lalu ketika kondisi masih memenuhi "Univesitas" akan dicetak kembali, lalu di cek lagi dan jika konsisi sudah tidak tepenuhi, maka "Bengkulu" akan dicetak','created_at' => '2024-10-11 13:57:55','updated_at' => '2024-10-11 13:57:55'),
