  array('id' => '3922','uts_id' => '5','mahasiswa_id' => '487','bank_soal_pembahasan_id' => '160','jawaban_id' => '475','nilai' => '1','alasan' => 'Konvesi implisit pada java digunakan untuk mengkonvesi tipe data dai ukuan yang kecil ke besa, sedangkan konvesi eksplisit digunakan untuk mengkonvesi tipe daa dai ukuan besa ke kecil.','created_at' => '2024-10-11 13:57:57','updated_at' => '2024-10-11 13:57:57'),
  array('id' => '3923','uts_id' => '5','mahasiswa_id' => '487','bank_soal_pembahasan_id' => '167','jawaban_id' => '498','nilai' => '1','alasan' => 'ekspesi 1 bena, ketika (int) (5 + 5.0) akan menghasilkan 10 kaena int adalah tipe data yang menyatakan bilangan bulat positif maupun negatif, dan angka 0 dibelakang koma akan hilang. Ekspesi ke 4 bena, (9 + double (4)) apabila dengan tipe data double akan menghailkan 13.0, kaena double meupakan tipe data yang menyatakan atau menyimpan bilangan desimal.','created_at' => '2024-10-11 13:57:57','updated_at' => '2024-10-11 13:57:57'),
  array('id' => '3924','uts_id' => '5','mahasiswa_id' => '487','bank_soal_pembahasan_id' => '168','jawaban_id' => '505','nilai' => '0','alasan' => 'Ketika membuat pogam, langkah petama adalah membuat kelas public class data {, lalu membuat methode utama public static void main(String [] args) {, lalu masukkan vaiabel dan nilai vaiabelnya String s = “012345”, kaena pada soal yang diminta nilai angka 2 dai tipe data sting, maka yang dimasukkan tipe data sting dan nilai vaiabelnya,  kemudian masukkan fungsi untuk mencetak  nilai angka 2, maka menggunakan System.out.println(s.indexOf(2)); untuk mengecek letal nilai angka 2.','created_at' => '2024-10-11 13:57:57','updated_at' => '2024-10-11 13:57:57'),
  array('id' => '3925','uts_id' => '5','mahasiswa_id' => '487','bank_soal_pembahasan_id' => '172','jawaban_id' => '527','nilai' => '1','alasan' => '0< 10 adalah tue dan 20<10 adalah false, maka hasil ekspesi I adalah false  kaena pada opeato AND apabila tue betemu dengan false, maka hasilnya false. 50<10 false dan 10<20 tue, maka hasil ekspesi II adalah tue, kaena pada opeato O ketika false betemu tue, maka hasilnya tue.','created_at' => '2024-10-11 13:57:57','updated_at' => '2024-10-11 13:57:57'),
  array('id' => '3926','uts_id' => '5','mahasiswa_id' => '487','bank_soal_pembahasan_id' => '176','jawaban_id' => '543','nilai' => '1','alasan' => '','created_at' => '2024-10-11 13:57:57','updated_at' => '2024-10-11 13:57:57'),
  array('id' => '3927','uts_id' => '5','mahasiswa_id' => '487','bank_soal_pembahasan_id' => '180','jawaban_id' => '560','nilai' => '1','alasan' => '','created_at' => '2024-10-11 13:57:57','updated_at' => '2024-10-11 13:57:57'),
  array('id' => '3928','uts_id' => '5','mahasiswa_id' => '487','bank_soal_pembahasan_id' => '181','jawaban_id' => '563','nilai' => '0','alasan' => 'Pilihan C adalah pilihan yang tepat. n=11, beati 11>11adalah false dan 11<=22 adalah tue kaena 11 memang kuang dai 22. Lalu, pada opeato O ketika false dan tue, maka luaan yang dihasilkan adalah tue.','created_at' => '2024-10-11 13:57:57','updated_at' => '2024-10-11 13:57:57'),
