  array('id' => '3931','uts_id' => '5','mahasiswa_id' => '487','bank_soal_pembahasan_id' => '195','jawaban_id' => '620','nilai' => '0','alasan' => 'Langkah petama adalah membuat kelas pogam telebih dahulu yaitu class moto, lalu dilanjutkan dengan membuat metode utama void penumpang() yang menyatakan moto hanya mampu mengangkat dua penumpang, lalu masukkan kelas anak dai kendaaan yaitu moto class Kendaraan extends Motor, kemudia masukkan void bejalan() yang menyatakan moto dapat bejalan menggunakan bensin.','created_at' => '2024-10-11 13:57:57','updated_at' => '2024-10-11 13:57:57'),
  array('id' => '3932','uts_id' => '5','mahasiswa_id' => '487','bank_soal_pembahasan_id' => '198','jawaban_id' => '0','nilai' => '0','alasan' => '','created_at' => '2024-10-11 13:57:57','updated_at' => '2024-10-11 13:57:57'),
  array('id' => '3933','uts_id' => '5','mahasiswa_id' => '487','bank_soal_pembahasan_id' => '203','jawaban_id' => '652','nilai' => '0','alasan' => 'Kaena tidak ada kunci continue untuk melewati peulangan atau beak untuk menghentikan peulangan, maka pogam akan mengecek teus dan menampilkan semua output','created_at' => '2024-10-11 13:57:57','updated_at' => '2024-10-11 13:57:57'),
  array('id' => '3934','uts_id' => '5','mahasiswa_id' => '487','bank_soal_pembahasan_id' => '209','jawaban_id' => '676','nilai' => '0','alasan' => '','created_at' => '2024-10-11 13:57:57','updated_at' => '2024-10-11 13:57:57'),
  array('id' => '3935','uts_id' => '5','mahasiswa_id' => '487','bank_soal_pembahasan_id' => '212','jawaban_id' => '684','nilai' => '0','alasan' => 'Ketiga kondisi pada pogam diatas akan menghasilkan luaan yang sama, yaitu "Sama". kaena kesesuaian antaa nilai yang dimasukkan. Apabila nilai yang diinput sesuai dengan kondisi yang ditentukan, maka pogam akan mencetak kondisi tesebut. Sebagai contoh pada kondisi 1, yaitu  if (string == "UNIB") {
            System.out.println("1. Sama ");
        } else {
            System.out.println("1. Tidak Sama ");
        }
        apabila nilai vaiabel yang dimasukkan bukan UNIB, maka pogam akan mencetak Tidak Sama kaena kondisi petama tidak tepenuhi.','created_at' => '2024-10-11 13:57:57','updated_at' => '2024-10-11 13:57:57'),
  array('id' => '3936','uts_id' => '5','mahasiswa_id' => '487','bank_soal_pembahasan_id' => '215','jawaban_id' => '698','nilai' => '1','alasan' => '','created_at' => '2024-10-11 13:57:57','updated_at' => '2024-10-11 13:57:57'),
  array('id' => '3937','uts_id' => '5','mahasiswa_id' => '487','bank_soal_pembahasan_id' => '220','jawaban_id' => '717','nilai' => '1','alasan' => 'p=0 beati peulangan dimulai dai 0 dan while<2 beati batas peulangan<2. Output mencetak "Univesitas Univesitas bengkulu" kaena petama sistem akan mencetak Univesitas lalu mengecek kondisi kembali apakah masih memenuhi dan "Univesitas" di incement, lalu ketika kondisi masih memenuhi "Univesitas" akan dicetak kembali, lalu di cek lagi dan jika konsisi sudah tidak tepenuhi, maka "Bengkulu" akan dicetak','created_at' => '2024-10-11 13:57:57','updated_at' => '2024-10-11 13:57:57'),
  array('id' => '3938','uts_id' => '5','mahasiswa_id' => '487','bank_soal_pembahasan_id' => '225','jawaban_id' => '736','nilai' => '1','alasan' => 'Bena, peulangan tidak tebatas adalah kondisi peulangan yang tidak bisa behennti kaena tidak ada kata kunci yang befungsi untuk menghentikan. Pulangan dapat benilai tue dan false, kaena tedapat kondisi yang haus dipenuhi','created_at' => '2024-10-11 13:57:57','updated_at' => '2024-10-11 13:57:57'),
  array('id' => '3939','uts_id' => '5','mahasiswa_id' => '487','bank_soal_pembahasan_id' => '226','jawaban_id' => '740','nilai' => '1','alasan' => 'Kata kunci continue befungsi untuk melewatkan pogam dan melanjutkan ke iteasi atau peulangan beikutnya. Pada kondisi petama, angka yang dicetak adalah angka yang habois dibagi7. Sehingga, apabila ingin menghasilkan angka yang habis dibagi 14, pelu menggunakan kata kunci continue untuk melewati loop atau peulangan petama.','created_at' => '2024-10-11 13:57:57','updated_at' => '2024-10-11 13:57:57'),
